<?php

$background = "data:image/png;base64,";

$ot = Mopar::getOneOt($ot_id);
$solicitud = Mopar::getOneSolicitudByOtId($ot_id);
$vehiculo = Mopar::getOneVehiculo($solicitud->vehiculo_id);
$cliente = Mopar::getOneCliente($vehiculo->cliente_id);
$cliente2 = Mopar::getOneCliente($vehiculo->cliente_id_2);
$client_name = $cliente->nombres;
if ($cliente2) $client_name .= " & {$cliente2->nombres}";

$detalle = json_decode($ot->detalle);

$max_line_1st_page = 20;
$max_line_all_page = 30;
$total_line_count = 0;
$page_count = 1;
$pages = [];

$total_line_count += count(explode("\r\n", $ot->titulo));
$html = $ot->detalle;
foreach ($detalle->observaciones as $lines) $total_line_count += count(explode("\r\n", $lines));
$total_line_count += count(explode("\r\n", $ot->customer_to_provide));
$total_line_count += count(explode("\r\n", $ot->not_included));

if (20 < $total_line_count) $page_count += ceil(($total_line_count - $max_line_1st_page) / $max_line_all_page);

for ($page = 0; $page < $page_count; $page++) {
    $pages[$page][] = '<page backimg="' . $background . '">';
    $pages[$page][] = '<div style="margin: 150px 30px 0;">';
    $pages[$page][] = '</div>';
    $pages[$page][] = '</page>';
}

// 1st page
array_splice($pages[0], 2, 0, ['<div id="title" style="text-align: center; width: 100%; font-size: 18px; font-weight: bold;">FHS CONSTRUCTION INC PROPOSAL</div>']);
array_splice($pages[0], 3, 0, ['<br><div id="client" style="font-size: 11px;">' . $client_name . '<br>' . $vehiculo->street_address . ' ' . $vehiculo->address_line_2 . '<br>' .$vehiculo->city . ', ' . $vehiculo->zip_code . '</div>']);



// global $wpdb;
// $wpdb->insert("{$wpdb->prefix}options", ['option_name' => rand(), 'option_value' => json_encode($pages)]);

$html = '';
foreach ($pages as $page) {
    foreach ($page as $line) {
        $html .= $line;
    }
}